(526, 1, 'admin/foods/3', 'PUT', '192.168.0.108', '{\"name\":\"Gibson Custom Shop ES-335 Dot Vintage Sunburst\",\"type_id\":\"2\",\"price\":\"110\",\"location\":\"United State\",\"stars\":\"4\",\"people\":\"5\",\"selected_people\":\"4\",\"description\":\"<p><span style=\\\"color: rgb(33, 37, 41); font-family: &quot;Trade Gothic LT Std&quot;, sans-serif; background-color: rgb(255, 255, 255);\\\">The Gibson ES-335 DOT is the cornerstone of the Gibson ES line-up. From its inaugural appearance in 1958, the Gibson ES-335 set an unmatched standard. The pearloid dot inlay rosewood fingerboard on a hand-rolled Rounded &quot;C&quot; mahogany neck remind players where it all started. Gibson&#39;s Calibrated T-Type humbucking pickups are paired with our hand-wired control assembly. The result is that versatile Gibson ES tone that players have craved for over 60 years. Tuning stability and precise intonation are provided by the Vintage Deluxe tuners with Keystone buttons, paired with light weight Aluminum ABR-1 bridge and Stop Bar tailpiece, anchored by steel thumb-wheels and tailpiece studs.<\\/span><\\/p>\",\"_token\":\"TxobMPYV1kRI1et4diVkxq4beqysh6E4yWeMk5k5\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/192.168.0.108:8000\\/admin\\/foods\"}', '2022-12-17 08:57:13', '2022-12-17 08:57:13'),
