(538, 1, 'admin/foods/4', 'PUT', '192.168.0.108', '{\"name\":\"Ibanez Prestige AZ2204N Electric Guitar, Antique White Blonde\",\"type_id\":\"3\",\"price\":\"52\",\"location\":\"Japan\",\"stars\":\"4\",\"people\":\"5\",\"selected_people\":\"3\",\"description\":\"<p id=\\\"mntl-sc-block_1-0\\\" class=\\\"comp mntl-sc-block mntl-sc-block-html\\\" style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 1rem; padding: 0px; letter-spacing: -0.1px; counter-reset: section 0; font-family: &quot;Work Sans&quot;, Arial, sans-serif; font-size: 17px; white-space: normal; background-color: rgb(255, 255, 255);\\\"><span style=\\\"color: rgb(74, 74, 74); font-family: Lato, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; letter-spacing: 0.16px; background-color: rgb(255, 255, 255);\\\">The AZ2204N is an AZ series solid body electric guitar model introduced by Ibanez for 2021. It is produced in Japan by Fujigen as part of the upscale Prestige line. The AZ2204N features an alder body bolted to a 21S-Tech roasted maple oval C shaped neck with a compound radius rosewood fingerboard with 22 stainless steel frets, mother of pearl dot position markers and luminescent side dots. The AZ2204N employs a dyna-MIX9 switching system with an &quot;Alter switch&quot; toggle which allows the user to access nine distinct tones. The Alter switch allows the player to access two modes with the single coils connected in series creating a tone similar to a second humbucker.<\\/span><\\/p><p><br\\/><\\/p>\",\"_token\":\"TxobMPYV1kRI1et4diVkxq4beqysh6E4yWeMk5k5\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/192.168.0.108:8000\\/admin\\/foods\"}', '2022-12-17 09:04:22', '2022-12-17 09:04:22'),
