(566, 1, 'admin/foods/5', 'PUT', '192.168.0.108', '{\"name\":\"Ibanez RG350DXZ-WH Electric Guitar, White\",\"type_id\":\"3\",\"price\":\"13\",\"location\":\"United State\",\"stars\":\"5\",\"people\":\"5\",\"selected_people\":\"4\",\"description\":\"<p><span style=\\\"color: rgb(10, 10, 10); font-family: Lato, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; letter-spacing: 0.16px; background-color: rgb(255, 255, 255);\\\">The most modern manufacturing techniques, old-world Japanese craftsmanship, and innovative design fed by input from musicians all across the globe are the cornerstones that go into the build of every Ibanez instrument. The RG Standard series gives you the features of a far more expensive guitar, but at an affordable price. Quantum pickups, a Wizard III maple neck, solid ash body and jumbo frets make these guitars the ideal choice for the aspiring metal shredder. The neck and body have been ergonomically carved to be as thin and lightweight as possible without sacrificing any rigidity or tone, so the guitar doesn&#39;t get in your way and you are only limited by your own skills no matter what style you play.<\\/span><\\/p>\",\"_token\":\"TxobMPYV1kRI1et4diVkxq4beqysh6E4yWeMk5k5\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/192.168.0.108:8000\\/admin\\/foods\"}', '2022-12-17 11:12:29', '2022-12-17 11:12:29'),
