(569, 1, 'admin/foods/6', 'PUT', '192.168.0.108', '{\"name\":\"Gibson Custom Shop 1964 SG Standard Reissue With Maestro Vibrola - Cherry Red\",\"type_id\":\"2\",\"price\":\"110\",\"location\":\"Uni\",\"stars\":\"4\",\"people\":\"3\",\"selected_people\":\"3\",\"description\":\"<p><span style=\\\"color: rgb(33, 37, 41); font-family: &quot;Trade Gothic LT Std&quot;, sans-serif; white-space: pre-wrap; background-color: rgb(255, 255, 255);\\\">Regardless of the fact that George Harrison and Eric Clapton rocked a &#39;64 SG\\u2122 Standard, that model year was clearly a standout for SGs in general. The clunky side-pull vibrato had been replaced by the dependable Maestro Vibrola. The neck profiles had increased in size, resembling the profile found on 1959 Les Pauls\\u2122. And the balance, playability and look of the SG seemed to come into its own. For all those reasons, the Gibson Custom Shop is proud to present the newest member of the Historic Reissue family -- the 1964 SG Standard Reissue. Along with the Maestro\\u2122 Vibrola and chunky neck . . .<\\/span><\\/p>\",\"_token\":\"TxobMPYV1kRI1et4diVkxq4beqysh6E4yWeMk5k5\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/192.168.0.108:8000\\/admin\\/foods\"}', '2022-12-17 11:15:17', '2022-12-17 11:15:17'),
