(575, 1, 'admin/foods/7', 'PUT', '192.168.0.108', '{\"name\":\"Cuban Fufu\",\"type_id\":\"2\",\"price\":\"135\",\"location\":\"Cuba\",\"stars\":\"5\",\"people\":\"1\",\"selected_people\":\"2\",\"description\":\"<p><span style=\\\"color: rgb(15, 15, 15); background-color: rgb(255, 255, 255); font-family: arial, helvetica, sans-serif;\\\">Limited for the year 2020 is the Modern Satin Flame. It\\u2019s built on a solid foundation of classic tone woods, Mahogany and Maple, and it\\u2019s available in four gorgeous finishes. The entire guitar is finished in satin, which feels as good as it looks. The Roasted Maple Modern Elliptical neck adds some punch and focus to the tone and the HSH pickup configuration covers the gamut of vintage and modern tones.<\\/span><\\/p>\",\"_token\":\"TxobMPYV1kRI1et4diVkxq4beqysh6E4yWeMk5k5\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/192.168.0.108:8000\\/admin\\/foods\"}', '2022-12-17 11:17:07', '2022-12-17 11:17:07'),
