INSERT INTO `admin_operation_log` (`id`, `user_id`, `path`, `method`, `ip`, `input`, `created_at`, `updated_at`) VALUES
(578, 1, 'admin/foods/8', 'PUT', '192.168.0.108', '{\"name\":\"PRS SE Silver Sky Electric Guitar, Stone Blue\",\"type_id\":\"3\",\"price\":\"20\",\"location\":\"china\",\"stars\":\"4\",\"people\":\"3\",\"selected_people\":\"2\",\"description\":\"<p><span style=\\\"color: rgb(10, 10, 10); font-family: Lato, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; letter-spacing: 0.16px; background-color: rgb(255, 255, 255);\\\">The PRS SE Silver Sky is a familiar iteration of the original Silver Sky model that was first introduced with John Mayer in 2018. This workhorse guitar provides ample tone and playability in four distinct colors, delivering looks, feel, and sound.&nbsp;The PRS SE Silver Sky starts with a poplar body, bolt-on maple neck, and rosewood fretboard with PRS trademark bird inlays. The 22-fret, 25.5\\u201d scale length neck features the original 635JM carve and an 8.5\\u201d fretboard radius, so the PRS SE Silver Sky will feel right at home. Plug it in, and the three single-coil 635JM \\u201cS\\u201d pickups will bark and sing. This guitar is anchored by a two-point steel tremolo, synthetic bone nut, and vintage-style tuners. Other design features include the PRS Silver Sky inverted headstock shape and the PRS double-acting truss rod (accessible from the front of the headstock for ease of use). Ships with PRS Classic 10-46 strings and gig bag.<\\/span><\\/p>\",\"_token\":\"TxobMPYV1kRI1et4diVkxq4beqysh6E4yWeMk5k5\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/192.168.0.108:8000\\/admin\\/foods\"}', '2022-12-17 11:18:20', '2022-12-17 11:18:20'),
