(581, 1, 'admin/foods/9', 'PUT', '192.168.0.108', '{\"name\":\"D\'Angelico Premier DC Boardwalk Electric Guitar, Iced Blue Metallic\",\"type_id\":\"3\",\"price\":\"23\",\"location\":\"United State\",\"stars\":\"4\",\"people\":\"3\",\"selected_people\":\"3\",\"description\":\"<p style=\\\"box-sizing: inherit; padding: 0px; margin-top: 16px; margin-bottom: 16px; color: rgb(61, 61, 61); font-family: Raleway, sans-serif; font-size: 18px; white-space: normal;\\\"><span style=\\\"color: rgb(102, 102, 102); font-family: &quot;Josefin Sans&quot;, sans-serif; background-color: rgb(255, 255, 255);\\\">Unique variations on a series favorite, the Premier DC Boardwalk is a sleek double-cutaway semi-hollow with a refreshed aesthetic and upgraded electronics. Available with USA Seymour Duncan Humbuckers or P-90&#39;s, the DC Boardwalk offers full-bodied mid-range tones with an articulate high end. Perfectly balanced and featuring a slim-C neck shape, the Premier DC Boardwalk promises remarkable comfort\\u2014while cream binding, chrome hardware, and a group of stunning finishes provide undeniable details.<\\/span><\\/p><p><br\\/><\\/p>\",\"_token\":\"TxobMPYV1kRI1et4diVkxq4beqysh6E4yWeMk5k5\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/192.168.0.108:8000\\/admin\\/foods\"}', '2022-12-17 11:19:59', '2022-12-17 11:19:59'),
