(584, 1, 'admin/foods/10', 'PUT', '192.168.0.108', '{\"name\":\"Duesenberg Paloma Electric Guitar in Red Sparkle\",\"type_id\":\"2\",\"price\":\"12\",\"location\":\"United State\",\"stars\":\"4\",\"people\":\"3\",\"selected_people\":\"3\",\"description\":\"<p class=\\\"rtejustify\\\" style=\\\"box-sizing: inherit; margin-top: 1em; margin-bottom: 1em; text-align: justify; color: rgb(228, 226, 213); font-family: ArialMT, Arial; font-size: 14px; white-space: normal; background-color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">The Paloma is a&nbsp;<strong style=\\\"box-sizing: inherit;\\\">solidbody<\\/strong>,&nbsp;<strong style=\\\"box-sizing: inherit;\\\">three pickup<\\/strong>, 22 fret electric guitar, featuring an&nbsp;<strong style=\\\"box-sizing: inherit;\\\">alder body<\\/strong>, short Duesenberg&nbsp;<strong style=\\\"box-sizing: inherit;\\\">Radiator Tremola<\\/strong>&nbsp;and a set neck with a 648mm scale.<\\/span><\\/p><p class=\\\"rtejustify\\\" style=\\\"box-sizing: inherit; margin-top: 1em; margin-bottom: 1em; text-align: justify; color: rgb(228, 226, 213); font-family: ArialMT, Arial; font-size: 14px; white-space: normal; background-color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">The Paloma is for those who seek ultimate flexibility. The three pickup layout featuring our&nbsp;<strong style=\\\"box-sizing: inherit;\\\">Grand VintageHumbucker<\\/strong>&nbsp;and two matched Duesenberg Singlecoils,&nbsp;<strong style=\\\"box-sizing: inherit;\\\">Pearlito<\\/strong>&nbsp;and&nbsp;<strong style=\\\"box-sizing: inherit;\\\">AlnicoBlade<\\/strong>, offer a wide variety of sounds for any situation. The four pickup combinations are accessible through our new&nbsp;<strong style=\\\"box-sizing: inherit;\\\">4-Way rotary switch<\\/strong>. All of that is topped off by our premium Radiator Tremola, deluxe Diamond fretboard inlays and a beautifully shaped body contour.<\\/span><\\/p><p class=\\\"rtejustify\\\" style=\\\"box-sizing: inherit; margin-top: 1em; margin-bottom: 1em; text-align: justify; color: rgb(228, 226, 213); font-family: ArialMT, Arial; font-size: 14px; white-space: normal; background-color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">All our instruments are fitted with our own hardware, which you will only find on a Duesenberg. We design it with attention to even the smallest details to create truly unique instruments from tuner buttons to jack plates.<\\/span><\\/p><p class=\\\"rtejustify\\\" style=\\\"box-sizing: inherit; margin-top: 1em; margin-bottom: 1em; text-align: justify; color: rgb(228, 226, 213); font-family: ArialMT, Arial; font-size: 14px; white-space: normal; background-color: rgb(0, 0, 0);\\\"><span style=\\\"font-family: arial, helvetica, sans-serif;\\\">All our fretboards are carefully pleked and finished by hand for optimum playability and the smooth feel they are famous for.<\\/span><\\/p><p><br\\/><\\/p>\",\"_token\":\"TxobMPYV1kRI1et4diVkxq4beqysh6E4yWeMk5k5\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/192.168.0.108:8000\\/admin\\/foods\"}', '2022-12-17 11:23:43', '2022-12-17 11:23:43'),
