(595, 1, 'admin/foods/1', 'PUT', '192.168.0.108', '{\"name\":\"Vigier Excalibur Supra Rock Art\",\"type_id\":\"3\",\"price\":\"135\",\"location\":\"France\",\"stars\":\"4\",\"people\":\"5\",\"selected_people\":\"5\",\"description\":\"<p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; font-family: Poppins; font-size: 15px; white-space: normal; background-color: rgb(255, 255, 255);\\\">If you\'re looking for a one of a kind guitar, you can\'t go wrong with a Vigier Rock Art instrument. These guitars are all dipped in colors of your choosing for a swirl finish that is unique to every guitar. This Rock Art Vigier is a ripper of an Excaliber Supra HSH. The guitar features an alder body that has been naturally aged, so it\'s extremely resonant, toneful and solid. The maple neck has also been naturally dried for 3 years, and uses Vigiers 10\\/90 system- where in lieu of a truss rod, the guitar has a strip of carbon that keeps the wood extremely stable. This Excaliber Supra is loaded with a trio of DiMarzio pickups and features a Vigier tremolo bridge. Other features include over-sized locking tuners, a varnish neck finish, zero fret, and chrome hardware.<\\/p><p style=\\\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; font-family: Poppins; font-size: 15px; white-space: normal; background-color: rgb(255, 255, 255);\\\">Includes: Vigier Gigbag and Tremolo Arm<\\/p><p><br><\\/p>\",\"_token\":\"TxobMPYV1kRI1et4diVkxq4beqysh6E4yWeMk5k5\",\"_method\":\"PUT\",\"_previous_\":\"http:\\/\\/192.168.0.108:8000\\/admin\\/foods\"}', '2022-12-17 11:30:13', '2022-12-17 11:30:13'),
