INSERT INTO `foods` (`id`, `name`, `description`, `price`, `stars`, `people`, `selected_people`, `img`, `location`, `created_at`, `updated_at`, `type_id`) VALUES
(1, 'Vigier Excalibur Supra Rock Art', '<p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 10px; font-family: Poppins; font-size: 15px; white-space: normal; background-color: rgb(255, 255, 255);\">If you\'re looking for a one of a kind guitar, you can\'t go wrong with a Vigier Rock Art instrument. These guitars are all dipped in colors of your choosing for a swirl finish that is unique to every guitar. This Rock Art Vigier is a ripper of an Excaliber Supra HSH. The guitar features an alder body that has been naturally aged, so it\'s extremely resonant, toneful and solid. The maple neck has also been naturally dried for 3 years, and uses Vigiers 10/90 system- where in lieu of a truss rod, the guitar has a strip of carbon that keeps the wood extremely stable. This Excaliber Supra is loaded with a trio of DiMarzio pickups and features a Vigier tremolo bridge. Other features include over-sized locking tuners, a varnish neck finish, zero fret, and chrome hardware.</p><p style=\"box-sizing: border-box; margin-top: 0px; margin-bottom: 0px; font-family: Poppins; font-size: 15px; white-space: normal; background-color: rgb(255, 255, 255);\">Includes: Vigier Gigbag and Tremolo Arm</p><p><br></p>', 135, 4, 5, 5, 'images/8642276ca5d39857d841afa5a1af0088.jpg', 'France', '2021-11-17 02:09:08', '2022-12-17 11:31:50', 2),
(2, 'PRS Wood Library Mccarty 594 Soapbar', '<p><span style=\"color: rgb(51, 51, 51); font-family: montserratlight, sans-serif; font-size: 14px; background-color: rgb(255, 255, 255);\">Body Type | Not Specified Cutaway | Double cutaway Top Wood | Not Specified Body Wood Back and Sides | Not Specified Body Bracing Pattern | Not Specified Body Finish | Not Specified Orientation | Right Handed Neck Neck Shape | Pattern Vintage Nut Width | Not Specified Fretboard | Rosewood Neck Wood | Mahogany Scale Length | Not Specified Number of Frets | 22 Neck Finish | Not Specified Electronics Acoustic/Electric | Not Specified Other Headstock Overlay | Not Specified Tuning Machines | Not Specified Bridge | Not Specified Saddle and Nut | Not Specified Number of Strings | 6 String Case | Not Specified Accessories Included | Not Specified</span><span style=\"-webkit-font-smoothing: antialiased; font-weight: 700; color: rgb(54, 54, 51); font-family: GothamPro, sans-serif; font-size: 14px; background-color: rgb(239, 239, 239); box-sizing: border-box !important;\"></span></p>', 150, 5, 5, 3, 'images/cac107e9f02c54b7712b97dbf44d9c7c.jpg', 'United State', '2021-11-17 02:10:43', '2022-12-17 11:31:15', 3),
(3, 'Gibson Custom Shop ES-335 Dot Vintage Sunburst', '<p><span style=\"color: rgb(33, 37, 41); font-family: &quot;Trade Gothic LT Std&quot;, sans-serif; background-color: rgb(255, 255, 255);\">The Gibson ES-335 DOT is the cornerstone of the Gibson ES line-up. From its inaugural appearance in 1958, the Gibson ES-335 set an unmatched standard. The pearloid dot inlay rosewood fingerboard on a hand-rolled Rounded &quot;C&quot; mahogany neck remind players where it all started. Gibson&#39;s Calibrated T-Type humbucking pickups are paired with our hand-wired control assembly. The result is that versatile Gibson ES tone that players have craved for over 60 years. Tuning stability and precise intonation are provided by the Vintage Deluxe tuners with Keystone buttons, paired with light weight Aluminum ABR-1 bridge and Stop Bar tailpiece, anchored by steel thumb-wheels and tailpiece studs.</span></p>', 110, 4, 5, 4, 'images/e17f8b860a868e8ea7bc681ffed05006.jpg', 'United State', '2021-11-17 02:16:31', '2022-12-17 19:00:26', 3),
(6, 'Gibson Custom Shop 1964 SG Standard Reissue With Maestro Vibrola - Cherry Red', '<p><span style=\"color: rgb(33, 37, 41); font-family: &quot;Trade Gothic LT Std&quot;, sans-serif; white-space: pre-wrap; background-color: rgb(255, 255, 255);\">Regardless of the fact that George Harrison and Eric Clapton rocked a &#39;64 SG Standard, that model year was clearly a standout for SGs in general. The clunky side-pull vibrato had been replaced by the dependable Maestro Vibrola. The neck profiles had increased in size, resembling the profile found on 1959 Les Pauls. And the balance, playability and look of the SG seemed to come into its own. For all those reasons, the Gibson Custom Shop is proud to present the newest member of the Historic Reissue family -- the 1964 SG Standard Reissue. Along with the Maestro Vibrola and chunky neck . . .</span></p>', 110, 4, 3, 3, 'images/ebc3b1cab332cf1e4ec639410a6fc0a5.jpg', 'United State', '2021-12-23 07:03:24', '2022-12-17 11:15:29', 2),
(7, 'Suhr Modern Satin Flame Island Burst 2020 Limited Edition', '<p><span style=\"color: rgb(15, 15, 15); background-color: rgb(255, 255, 255); font-family: arial, helvetica, sans-serif;\">Limited for the year 2020 is the Modern Satin Flame. Its built on a solid foundation of classic tone woods, Mahogany and Maple, and its available in four gorgeous finishes. The entire guitar is finished in satin, which feels as good as it looks. The Roasted Maple Modern Elliptical neck adds some punch and focus to the tone and the HSH pickup configuration covers the gamut of vintage and modern tones.</span></p>', 135, 5, 1, 2, 'images/5a31f5c55572bb24b44ba135be09ef9c.jpg', 'Cuba', '2021-12-23 07:04:49', '2022-12-17 11:25:29', 2),
(8, 'PRS SE Silver Sky Electric Guitar, Stone Blue', '<p><span style=\"color: rgb(10, 10, 10); font-family: Lato, HelveticaNeue, &quot;Helvetica Neue&quot;, Helvetica, Arial, sans-serif; letter-spacing: 0.16px; background-color: rgb(255, 255, 255);\">The PRS SE Silver Sky is a familiar iteration of the original Silver Sky model that was first introduced with John Mayer in 2018. This workhorse guitar provides ample tone and playability in four distinct colors, delivering looks, feel, and sound.&nbsp;The PRS SE Silver Sky starts with a poplar body, bolt-on maple neck, and rosewood fretboard with PRS trademark bird inlays. The 22-fret, 25.5 scale length neck features the original 635JM carve and an 8.5 fretboard radius, so the PRS SE Silver Sky will feel right at home. Plug it in, and the three single-coil 635JM S pickups will bark and sing. This guitar is anchored by a two-point steel tremolo, synthetic bone nut, and vintage-style tuners. Other design features include the PRS Silver Sky inverted headstock shape and the PRS double-acting truss rod (accessible from the front of the headstock for ease of use). Ships with PRS Classic 10-46 strings and gig bag.</span></p>', 20, 4, 3, 2, 'images/2c22954073ef760e648482a798effc79.jpg', 'china', '2021-12-25 17:36:29', '2022-12-17 11:18:20', 3),
(9, 'D\'Angelico Premier DC Boardwalk Electric Guitar, Iced Blue Metallic', '<p style=\"box-sizing: inherit; padding: 0px; margin-top: 16px; margin-bottom: 16px; color: rgb(61, 61, 61); font-family: Raleway, sans-serif; font-size: 18px; white-space: normal;\"><span style=\"color: rgb(102, 102, 102); font-family: &quot;Josefin Sans&quot;, sans-serif; background-color: rgb(255, 255, 255);\">Unique variations on a series favorite, the Premier DC Boardwalk is a sleek double-cutaway semi-hollow with a refreshed aesthetic and upgraded electronics. Available with USA Seymour Duncan Humbuckers or P-90&#39;s, the DC Boardwalk offers full-bodied mid-range tones with an articulate high end. Perfectly balanced and featuring a slim-C neck shape, the Premier DC Boardwalk promises remarkable comfortwhile cream binding, chrome hardware, and a group of stunning finishes provide undeniable details.</span></p><p><br/></p>', 23, 4, 3, 3, 'images/e9538f91b5e173f403acb92bfc9ddb47.jpg', 'United State', '2021-12-26 22:27:38', '2022-12-17 11:20:00', 3),
(10, 'Duesenberg Paloma Electric Guitar in Red Sparkle', '<p class=\"rtejustify\" style=\"box-sizing: inherit; margin-top: 1em; margin-bottom: 1em; text-align: justify; color: rgb(228, 226, 213); font-family: ArialMT, Arial; font-size: 14px; white-space: normal; background-color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif;\">The Paloma is a&nbsp;<strong style=\"box-sizing: inherit;\">solidbody</strong>,&nbsp;<strong style=\"box-sizing: inherit;\">three pickup</strong>, 22 fret electric guitar, featuring an&nbsp;<strong style=\"box-sizing: inherit;\">alder body</strong>, short Duesenberg&nbsp;<strong style=\"box-sizing: inherit;\">Radiator Tremola</strong>&nbsp;and a set neck with a 648mm scale.</span></p><p class=\"rtejustify\" style=\"box-sizing: inherit; margin-top: 1em; margin-bottom: 1em; text-align: justify; color: rgb(228, 226, 213); font-family: ArialMT, Arial; font-size: 14px; white-space: normal; background-color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif;\">The Paloma is for those who seek ultimate flexibility. The three pickup layout featuring our&nbsp;<strong style=\"box-sizing: inherit;\">Grand VintageHumbucker</strong>&nbsp;and two matched Duesenberg Singlecoils,&nbsp;<strong style=\"box-sizing: inherit;\">Pearlito</strong>&nbsp;and&nbsp;<strong style=\"box-sizing: inherit;\">AlnicoBlade</strong>, offer a wide variety of sounds for any situation. The four pickup combinations are accessible through our new&nbsp;<strong style=\"box-sizing: inherit;\">4-Way rotary switch</strong>. All of that is topped off by our premium Radiator Tremola, deluxe Diamond fretboard inlays and a beautifully shaped body contour.</span></p><p class=\"rtejustify\" style=\"box-sizing: inherit; margin-top: 1em; margin-bottom: 1em; text-align: justify; color: rgb(228, 226, 213); font-family: ArialMT, Arial; font-size: 14px; white-space: normal; background-color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif;\">All our instruments are fitted with our own hardware, which you will only find on a Duesenberg. We design it with attention to even the smallest details to create truly unique instruments from tuner buttons to jack plates.</span></p><p class=\"rtejustify\" style=\"box-sizing: inherit; margin-top: 1em; margin-bottom: 1em; text-align: justify; color: rgb(228, 226, 213); font-family: ArialMT, Arial; font-size: 14px; white-space: normal; background-color: rgb(0, 0, 0);\"><span style=\"font-family: arial, helvetica, sans-serif;\">All our fretboards are carefully pleked and finished by hand for optimum playability and the smooth feel they are famous for.</span></p><p><br/></p>', 12, 4, 3, 3, 'images/55dbbc0461b94dbac254b1361753a23e.jpg', 'United State', '2021-12-26 22:29:47', '2022-12-17 11:23:43', 2),
(11, '1969 Jos Yacopi Brazilian Rosewood Classical Guitar', '<p>This 1969 guitar has not remained in good condition but precious woods, exquisite decorative details, great power and a very distinctive timbre still prove it&#39;s the top of the range instruments from luthier Jos Yacopi<br/></p><p><br/></p>', 99, 5, 3, 3, 'images/bd90b0bfb74da1bfdefc2ea2a4623b3d.jpg', 'Brazil', '2021-12-26 22:35:34', '2022-12-17 11:29:28', 2),
(12, 'Fender Custom Shop 1957 Stratocaster Heavy Relic Sonic Blue over Pink Paisley Limited Edition', '<p><span style=\"font-family: SourceSansPro-Regular, -apple-system, system-ui, &quot;avenir next&quot;, avenir, &quot;Helvetica Neue&quot;, helvetica, ubuntu, roboto, noto, &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 18px; background-color: rgb(255, 255, 255);\">A&nbsp;</span><strong style=\"box-sizing: border-box; font-family: SourceSansPro-Regular, -apple-system, system-ui, &quot;avenir next&quot;, avenir, &quot;Helvetica Neue&quot;, helvetica, ubuntu, roboto, noto, &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 18px; white-space: normal; background-color: rgb(255, 255, 255);\">1957 Heavy Relic Stratocaster</strong><span style=\"font-family: SourceSansPro-Regular, -apple-system, system-ui, &quot;avenir next&quot;, avenir, &quot;Helvetica Neue&quot;, helvetica, ubuntu, roboto, noto, &quot;Segoe UI&quot;, Arial, sans-serif; font-size: 18px; background-color: rgb(255, 255, 255);\">&nbsp;with 2-tone sunburst under a blue sparkle finish, all on a lightweight ash body. In addition, it features a flash-coat lacquer tinted one-piece quartersawn maple neck.</span></p>', 140, 5, 5, 23, 'images/b3c9b4b004da60b7c805232bfa7286a8.jpg', 'United State', '2022-12-17 18:59:12', '2022-12-17 18:59:12', 2),
(13, 'Whammy Bar T-Shirt: Boutique Guitar Gallery', '<p><span style=\"color: rgb(243, 240, 236); font-family: iCielGTPressura; background-color: rgb(19, 19, 19);\">Represent your favorite guitar store with with this t-shirt, featuring The Whammy Bar logo..</span></p>', 15, 3, 3, 2, 'images/a4b4086979a14b291f7312105906b1d8.jpg', 'Viet Nam', '2022-12-29 09:52:02', '2022-12-29 09:52:02', 3),
(14, 'Rotosound RS77LD Jazz 77 Monel Flatwound Bass Guitar Strings - .045-.105 Standard Long Scale 4-string', '<p>Flat wound bass guitar strings<br/></p>', 15, 2, 1, 2, 'images/441cd53e3997f1628cedb9c05dc0b891.jpg', 'United State', '2022-12-29 09:53:28', '2022-12-29 09:54:47', 3),
(15, 'Ibanez Bass Workshop SRMS805-DTW 5-String Bass Guitar, Deep Twilight', '<ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p>BODY TYPE: Solid Body</p></li><li><p>BODY MATERIAL: Okoum w Burl Poplar top</p></li><li><p>BODY FINISH: High-Gloss</p></li><li><p>COLOR: Deep Twilight</p></li></ul><p><br/></p>', 26, 3, 1, 4, 'images/6cfe45238fd5b09d37cfb88bd84bae9d.jpg', 'Japan', '2022-12-29 10:07:33', '2022-12-29 10:07:33', 2),
(16, 'Neural DSP Quad Cortex Quad-Core Digital Effects Modeler/Profiling Floorboard', '<ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p>Multi-touch guitar and bass modeler with capture technology</p></li><li><p>Bright 7-inch multi-touch color display</p></li><li><p>Quad-Core SHARC DSP delivers a whopping amount of processing power</p></li><li><p>Preloaded with over 50 amps, 70 effects, and 1,000 cabs</p></li><li><p>Built-in looper with up to 4 minutes and 44 seconds of record time</p></li><li><p>Neural Capture digitizes your favorite amps, stomps, and cabs down to the component level</p></li><li><p>Bulletproof anodized aluminum chassis with 1.8mm glass display shield</p></li><li><p>Ultra-versatile I/O with patch-by-patch configurable routing</p></li><li><p>Audio and MIDI over USB with multiple audio playback modes</p></li><li><p>Dual-function rotary switches supply footswitch and knob control</p></li><li><p>Onboard Wi-Fi for wireless tone access, firmware updates, and cloud backups</p></li></ul>', 56, 5, 3, 4, 'images/5b1d03d30d6364ed43b70eab6427d46d.jpg', 'United State', '2022-12-29 10:08:57', '2022-12-29 10:08:57', 0),
(17, 'Gibson EDS-1275 Walnut Vintage 1970', '<ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p>BRAND: Gibson</p></li><li><p>NAME: Gibson EDS-1275 Walnut 1970s</p></li><li><p>YEAR: 1970</p></li><li><p>MADE IN: United States</p></li><li><p>CONDITION: Vintage</p></li><li><p>BODY TYPE: Solidbody</p></li><li><p>BODY MATERIAL: Mahogany</p></li><li><p>BODY FINISH: Lacquer</p></li><li><p>FINISH TYPE: Gloss</p></li><li><p>COLOR: Walnut</p></li><li><p>NECK MATERIAL: Mahogany</p></li><li><p>NECK SHAPE: Medium C</p></li><li><p>RADIUS: 12 Radius</p></li><li><p>1st NECK THICKNESS: .840</p></li><li><p>12st NECK THICKNESS: .990</p></li><li><p>FINGERBOARD MATERIAL: Rosewood</p></li><li><p>FINGERBOARD INLAY: Parallelogram Inlays</p></li><li><p>NUMBER OF FRETS: 22</p></li><li><p>SCALE LENGTH: 24.75</p></li><li><p>NUT WIDTH: 1.6875</p></li><li><p>NECK PICKUP: Gibson Pattern Number Humbucker</p></li><li><p>BRIDGE PICKUP: Gibson Pattern Number Humbucker</p></li><li><p>SWITCHING:</p></li><li><p>-3-way toggle switch in the middle of the body for pickup selection</p></li><li><p>-3-way toggle switch on the lower horn for 6-string/12-string neck selection</p></li><li><p>CONTROLS: 1 Volume/Tone for each neck</p></li></ul><p><br/></p>', 250, 2, 3, 4, 'images/73deb00e683ffb51c5d98733a7e6b1f7.jpg', 'United State', '2022-12-29 10:11:44', '2022-12-29 10:11:44', 2),
(18, 'Elixir 12057 Nanoweb Light 7-String Electric Guitar Strings 010-056', '<p>Guitar String</p>', 3, 2, 2, 3, 'images/9ecdd5982099e5f0f1c3c75532b4163d.jpg', 'Japan', '2022-12-29 10:13:38', '2022-12-29 10:13:38', 3),
(19, '1556-UNIVERSAL-AUDIO-OX-REACTIVE-AMP-ATTENUATOR-WITH-SPEAKER-MODELING', '<p>Reactive Load</p>', 39, 2, 4, 3, 'images/02a079c9e5d3250c1b2d7d874ba04eff.jpg', 'Japan', '2022-12-29 10:18:23', '2022-12-29 10:18:23', 2),
(20, 'Yamaha SG1802 Black (Made in Japan)', '<p>Yamaha<br/></p><p><br/></p>', 55, 4, 4, 5, 'images/a7cce76c73378715eba700242ade8d40.jpg', 'Japan', '2022-12-29 10:20:22', '2022-12-29 10:20:22', 3),
(21, 'Ibanez JS2410 Joe Satriani Signature Electric Guitar w/case, Muscle Car Orange', '<ul style=\"list-style-type: none;\" class=\" list-paddingleft-2\"><li><p>NECK MATERIAL: Rosewood</p></li><li><p>NECK SHAPE: JS 3pc Maple/Bubinga neck</p></li><li><p>RADIUS:&nbsp;9.84</p></li><li><p>1st NECK THICKNESS: 0.787&quot;</p></li><li><p>12st NECK THICKNESS: 0.877&quot;</p></li><li><p>FINGERBOARD MATERIAL: Rosewood</p></li><li><p>FINGERBOARD INLAY: Mother of Pearl</p></li><li><p>NUMBER OF FRETS: 24, Jumbo</p></li><li><p>SCALE LENGTH: 25.5&quot;</p></li><li><p>NUT WIDTH: 1.654</p></li></ul><p><br/></p>', 62, 5, 4, 4, 'images/497f495b872b5f63a6ae494e2621e3d5.jpg', 'Brazil', '2022-12-29 10:21:47', '2022-12-29 10:21:47', 2),
(22, 'Ernie Ball 40th Anniversary Volume Pedal', '<p>Since its introduction in 1977, the Ernie Ball Volume Pedal has been the leading choice for</p><p>musicians across the globe. The Enie Ball 40th Anniversary VP Pedal features a luxurious limited</p><p>edition slate black aluminum chassis with updated graphics for a striking appearance both on and</p><p>off stage. A redesigned ultra durable Kevlar cord improves potentiometer traction for precise</p><p>volume control and a super smooth foot sweep. Inspired by the rugged design af the original, the</p><p>pedal&#39;s compact extruded aluminum housing is virtually indestructible. Celebrate 40 years of</p><p>quality, performance, and reliability with this new anniversary edition volume pedal only from</p><p>Ernie Ball.</p><p><br/></p>', 3, 4, 3, 4, 'images/455eb420e7c4db59fae9fafed9437c75.jpg', 'United State', '2022-12-29 10:24:13', '2022-12-29 10:24:13', 3),
(23, 'G&L American L-2000 Natural', '<p>BODY TYPE: Solidbody<br/></p><p>BODY MATERIAL: 2-Pieces Ash</p><p>FINISH: Gloss</p><p>FINISH COLOR: Natural</p><p>NECK MATERIAL: Maple</p><p>RADIUS: 12&quot;</p><p><br/></p>', 25, 3, 3, 4, 'images/70736cd97c914c5a315ea4e7895ba5b4.jpg', 'United State', '2022-12-29 10:26:14', '2022-12-29 10:26:14', 3);
